import './App.css';
import { Route, Switch } from 'react-router-dom'
import Home from './pages/Home'
import Projects from './pages/Projects'

const App = () => {
  return (
    <div className="App">
      <Switch>
        <Route path ="/"> <Home/> </Route>
        <Route path ="/project/:id" component = {Projects} />
      </Switch>
    </div>

  );
};

export default App;
